import ReactDOM from "react-dom";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import ReXplore from "./Pages/ReXplore.js";
import Eat from "./Pages/Eat.js";
import JamLink from "./Pages/JamLink.js";
import Feedback from "./Pages/Student Feedback Intervention.js"
import Surveillance from "./Pages/Su"

import ProfilePage from './Pages/ProfilePage.js'



export default function App() {
  return (
    <BrowserRouter>
      <Routes>
          <Route index element={<ProfilePage />} />
          <Route path="ReXplore" element={<ReXplore />} />
          <Route path="eat" element={<Eat />} />
          <Route path="JamLink" element={<JamLink />} />
          <Route path="Student Feedback Intervention" element={<Feedback />} />
      </Routes>
    </BrowserRouter>
  );
}
